import React from 'react';
import Person from './Person';

const PersonList = ({persons}) => {
    return (
        <div>
           {
               persons.map(person => (
                   <Person 
                    key={person.id}
                    id={person.id}
                    name={person.name}
                    title={person.title}
                   />
               ))
           }
        </div>
    )
}

export default PersonList;
